import "./App.css";

function App() {
  return (
    <div class="middle">
      <div class="center">
        <h1>Welcome to Fam Reveal</h1>
        <form class="container">
          <label>Choose your family:</label>
          <input type="text" id="name" required />
          <div class="nes-field">
            <label for="name_field">Your name</label>
            <input type="text" id="name_field" class="nes-input"></input>
          </div>
          <button type="submit">Reveal!</button>
        </form>
      </div>
    </div>
  );
}

export default App;
